import { Switch, Route } from "react-router-dom";
import AllMeetupsPage from "./pages/AllMeetups";
import FavoritesPage from "./pages/Favorites";
import NewMeetupPage from "./pages/NewMeetup";

function App() {
  return (
    <div>
      <h1>My App</h1>
      <Route path="/">
        <AllMeetupsPage />
      </Route>
      <Route>
        <FavoritesPage />
      </Route>

      <Route path='new'>
        <NewMeetupPage />
      </Route>
    </div>
  );
}

export default App;
